      bio: 'Adults inhabit clear streams and mainly feed on epiphyte and biofilm on rocks in the wild.  Due to its possible amphidromous nature, as known to occur with its congeners (adults live and breed in freshwater streams; larvae hatched drift downstream and develop in marine environments; juveniles return to freshwater streams), blockage of the migration pathway  would cause a significant impact on this species. Ensuring no net loss of habitat, keeping the natural stream flow and maintaining the stream-ocean corridor are all essential for preserving this species (based on researches on its congeners; see Ref. 82683, 82684, 82685, 82689, 82690, 82692).  Collection conducted by aquarium hobbyists  also poses a serious threat to Stiphodon species in some regions  and this kind of activity should be strictly controlled .',
