      preferred_name: '',
      picture: 'http://eol.org/content/2009/09/16/06/59707_medium.jpg',
      bio: 'Elacatinus jarocho was found between 3\u201325 m depth on high profile coral reefs typically dominated by Montastrea cavernosa , M. annularis , Colpophyllia natans and skeletal reef framework. Elacatinus jarocho joins E. atronasus (B\u00f6hlke &amp; Robins) as the only twospecies in the genus to school in the water column. Small to large aggregations (12\u201360 individuals) of E. jarocho were normally found close to the reef near high profile corals or overhangs. Such reef structure presumablyprovides shelter from direct sunlight because aggregations were usually observed in darker, shaded areas rather than in direct sunlight. Individuals of E. jarocho, unlike E. atronasus, were never observed stationaryon any substrate, but rather hovered continuously about 5\u201325 cm above the reef, frequently in associationwith Coryphopterus hyalinus B\u00f6hlke &amp; Robins or C. personatus (Jordan &amp; Thompson). This specieswas not observed to clean other species or interact in other symbiotic relationships. Small and large individualscoexisted in the same aggregations and did not display territorial or hierarchical behaviors. Individual fishwould often, though not always, move slowly toward cover when approached to less than 1 m by scuba divers .',
      url: 'http://www.eol.org/pages/225941',
      rank: 'species',
