      bio: 'This species can often be observed basking on sunny days in pools . It has a broad diet, which includes large quantities of green algae, polychaete worms, crustaceans, small fishes, and insects . The range of food taken varies depending on the age of the fish. Younger giant gobies mainly take small items such as small amphipods and ostracods while older individuals take larger items, until a large proportion of the food intake consists of green algae .&nbsp;Both sexes live for about ten years, sexual maturity is reached at two to three years of age, and breeding occurs between March and May. Up to 12,000 eggs are laid per clutch ; the eggs are attached to the underside of stones and fertilised by the male who then guards them .  Females produce two clutches of eggs each year for about eight years .',
