      bio: 'A euryhaline species .  Juveniles and young adults occur in mangrove estuaries, the lower reaches of freshwater streams  and tidal creeks .  Adults are often found in groups around coral reefs .  Eventually migrate offshore to deeper reef areas, sometimes penetrating to depths in excess of 100 m.  Mainly nocturnal, this species feeds mostly on fishes and crustaceans.  Excellent food fish .  An important market species throughout the Indo-Pacific region, but never found in large quantities.  A good aquaculture species because it doesn\u2019t get rancid easily when frozen .  It commands a good export market price with no limit on body size .  No reported damaging diseases .  Found in Hong Kong live fish markets .  Max length is 104 cm, max weight 14.5 kg and max age 39 years for specimens from the east coast of Australia  .',
