      bio: 'Occur in the vicinity of coral or rocky reefs , often over adjacent sand flats and gravel patches .  Also trawled in deeper water on relatively flat bottoms.  Juveniles are frequently commensal with sea urchins .  Juveniles less than 20 cm long are common in near shore, turbid waters , in mangrove areas , or among both coastal and deeper water offshore reefs .  Juveniles can also be found swimming amongst the spines of urchins in shallow coastal bays .  They move to deeper waters as they grow larger , with large fish often moving into shallower water during the winter months .  They form schools of similar-sized individuals or are solitary .  Feed on fishes, crabs, stomatopods, other benthic crustaceans and cephalopods.  Marketed fresh, dried-salted and frozen .  Commercially important but in certain regions of the Indian Ocean, large individuals are known to cause ciguatera poisoning .',
