      sname: 'Halichoeres burekae Weaver & Rocha, 2007',
      cnames: ['Mardi Gras wrasse'],
      preferred_name: 'Mardi Gras wrasse',
      picture: '',
      bio: 'Collected over claystone, sponge, and coral substrata.  Adults were observed in smallschools along the reef crest mixed with Thalassoma bifasciatum, juvenile Bodianus rufus, and Chromis multilineata, while small juveniles ((12-18 mm TL) were observed in mixed schools with juvenile Clepticus parrae.  It feeds mainly on calanoid copepods and other plankton.  During courtship, terminal phase males:  raise the dorsal &#39;flag&#39; while approaching a female and keep the dorsal fin erect while in close proximity to her; primarily use pectoral \u2018&#39;labriform&#39; propulsion for locomotion unless making rapid rushes at a female from a distance, in which case the caudal fin and body are used for rapid propulsion to pursue her; typically circles the female with dorsal fin flared, also periodically flaring the caudal lobes; and, were observed to nip the female on the fins.  Agonistic interactions were also  observed between males, approaching each other with flaring gill plates and jaws, and rapidly fanning their pectoral fins .',
